import React from 'react';

import './styles.scss';
import { Search } from 'react-bootstrap-icons';
import { InputGroup, FormControl } from 'react-bootstrap';
class Detail extends React.Component {
    state = {};
    constructor(props) {
        super(props);

        this.state = {
            data: [
                {
                    id: "123",
                    date: "20/12/2002",
                    idKH: "123",
                    nameKH: "thanh thuy",
                    idNV: "123",
                    nameNV: "thanh thuy",
                    type: "online",
                    total: "120.000"
                },
                {
                    id: "321",
                    date: "20/12/2002",
                    idKH: "123",
                    nameKH: "thanh thuy",
                    idNV: "123",
                    nameNV: "thanh thuy",
                    type: "online",
                    total: "120.000"
                },
                {
                    id: "258",
                    date: "20/12/2002",
                    idKH: "123",
                    nameKH: "thanh thuy",
                    idNV: "123",
                    nameNV: "thanh thuy",
                    type: "online",
                    total: "120.000"
                }
            ],
            currentPage: 1,
            itemsPerPage: 2,
            selectedbillId: null,
            showModalAdd: false,
            showModalRemove: false,
            showModalUpdate: false,
        };
    }
    handleClick = (pageNumber) => {
        this.setState({
            currentPage: pageNumber,
        });
    };
    handleClickIdbillId = (billId) => {
        this.setState({
            selectedbillId: billId,
        });
    };
    openModalAdd = () => {
        this.setState({
            showModalAdd: true,
        });
    };

    closeModalAdd = () => {
        this.setState({
            showModalAdd: false,
        });
    };
    openModalUpdate = () => {
        this.setState({
            showModalUpdate: true,
        });
    };

    closeModalUpdate = () => {
        this.setState({
            showModalUpdate: false,
        });
    };
    openModalRemove = () => {
        this.setState({
            showModalRemove: true,
        });
    };

    closeModalRemove = () => {
        this.setState({
            showModalRemove: false,
        });
    };
    handleNameChange = (newName) => {
        const { selectedbillId, data } = this.state;
        const updatedData = data.map(bill =>
            bill.id === selectedbillId
                ? { ...bill, name: newName }
                : bill
        );
        this.setState({ data: updatedData });
    };


    render() {
        const { data, currentPage, itemsPerPage, selectedbillId, showModalAdd, showModalRemove, showModalUpdate } = this.state;

        // Calculate the index range for the current page
        const indexOfLastItem = currentPage * itemsPerPage;
        const indexOfFirstItem = indexOfLastItem - itemsPerPage;
        const currentItems = data.slice(indexOfFirstItem, indexOfLastItem);
        const totalPages = Math.ceil(data.length / itemsPerPage);
        const selectedbill = data.find(item => item.id === selectedbillId);
        const renderPageButtons = () => {
            const pageButtons = [];

            // Display all buttons if there are few pages
            if (totalPages <= 7) {
                for (let i = 1; i <= totalPages; i++) {
                    pageButtons.push(
                        <button className='p-2 px-3 fs-4 border border-1 me-2'
                            key={i}
                            onClick={() => this.handleClick(i)}
                            style={{ fontWeight: i === currentPage ? 'bold' : 'normal' }}
                        >
                            {i}
                        </button>
                    );
                }
            } else {
                // Display a subset of buttons with ellipsis
                const startPage = Math.max(1, currentPage - 2);
                const endPage = Math.min(totalPages, startPage + 4);

                if (startPage > 1) {
                    pageButtons.push(<span key="startEllipsis">...</span>);
                }

                for (let i = startPage; i <= endPage; i++) {
                    pageButtons.push(
                        <button className='p-2 fs-4 px-3  border border-1 me-2'
                            key={i}
                            onClick={() => this.handleClick(i)}
                            style={{ fontWeight: i === currentPage ? 'bold' : 'normal' }}
                        >
                            {i}
                        </button>
                    );
                }
                if (endPage < totalPages) {
                    pageButtons.push(<span key="endEllipsis">...</span>);
                }
            }
            return pageButtons;
        };
        return (
            <div className='container'>
                <div className='row ms-3 mt-4'>
                    <div className='card border border-2 rounded-3'>
                        <div className='card-content p-4'>
                            <div className='row'>
                                <div className='col-3 px-4'>
                                    <div className="col-md-12 mb-4">
                                        <label for="name" className="form-label fs-5">M ha n :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.id || ''} />
                                        <div className="invalid-feedback">
                                            M ha n
                                        </div>
                                    </div>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">M nhn vin :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.idNV || ''} />
                                        <div className="invalid-feedback">
                                            M nhn vin
                                        </div>
                                    </div>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">Tn nhn vin :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.nameNV || ''} />
                                        <div className="invalid-feedback">
                                            Tn nhn vin
                                        </div>
                                    </div>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">Ngy mua :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.date || ''} />
                                        <div className="invalid-feedback">
                                            Ngy mua
                                        </div>
                                    </div>
                                </div>
                                <div className='col-3 px-4'>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">M khch hng :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.idKH || ''} />
                                        <div className="invalid-feedback">
                                            M khch hng
                                        </div>
                                    </div>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">Tn khch hng :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.nameKH || ''} />
                                        <div className="invalid-feedback">
                                            Tn khch hng
                                        </div>
                                    </div>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">Tng tin :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.total || ''} />
                                        <div className="invalid-feedback">
                                            Tng tin
                                        </div>
                                    </div>
                                    <div className="col-md-12 mb-4">
                                        <label className="form-label fs-5">Hnh thc mua hng :</label>
                                        <input type="text" className="form-control p-2 rounded-3 fs-5" value={selectedbill?.type || ''} />
                                        <div className="invalid-feedback">
                                            Hnh thc mua hng
                                        </div>
                                    </div>
                                </div>
                                <div className='col-6 px-4 py-3'>
                                    <div className='card bg-light-success h-100 '>
                                        <div className='card-content p-4'>
                                            <label className='fs-5 fw-bold'>Bao gm:</label>
                                            <div className='table-container overflow-auto'>
                                                <table className='table  table-hover table-bordered fs-5  mt-2  '>
                                                    <thead>
                                                        <tr className="table-secondary">
                                                            <th scope="col" className='p-2 col-2'>M</th>
                                                            <th scope="col" className='p-2'>Tn thuc</th>
                                                            <th scope="col" className='p-2 col-2'>SL</th>
                                                            <th scope="col" className='p-2 col-3'>Gi</th>

                                                        </tr>
                                                    </thead>
                                                    <tbody>
                                                        <tr>
                                                            <td className='p-2'>123</td>
                                                            <td className='p-2'>Paradall</td>
                                                            <td className='p-2'>1</td>
                                                            <td className='p-2'>13.000</td>
                                                        </tr>
                                                    </tbody>
                                                </table>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
                <div className='mt-4 px-3'>
                    <div className='row my-3'>
                        <div className='col-3'>
                            <div className="form-group">
                                <label>
                                    <h5 >Tm kim</h5>
                                </label>
                                <InputGroup className="w-100 ms-3">
                                    <FormControl className='p-3 fs-5'
                                        placeholder="M ha n"
                                        style={{ height: '100%' }}
                                        aria-label="Light"
                                        aria-describedby="basic-addon2"
                                    />
                                    <InputGroup.Text id="basic-addon2" className='p-3'>
                                        <Search />
                                    </InputGroup.Text>
                                </InputGroup>
                            </div>
                        </div>
                        <div className='col-2 ms-5'>
                            <div className="form-group">
                                <label>
                                    <h5 >Ngy</h5>
                                </label>
                                <input type="date" className="form-control p-3 rounded-3 fs-5" />
                            </div>
                        </div>
                        <div className='col-2 ms-5'>
                            <div className="form-group">
                                <label>
                                    <h5 >Loi</h5>
                                </label>
                                <select className="form-control p-3 fs-5 ms-3 select2-hidden-accessible" required
                                >
                                    <option disabled selected className='fs-5'>Chn loi</option>
                                    <option value="1" className='fs-5'>Online</option>
                                    <option value="2" className='fs-5'>Trc tip</option>
                                </select>
                            </div>
                        </div>
                        <div className='col-2'></div>
                        <div className='col-2 ms-5 d-flex align-items-center justify-content-end'>
                            <button className='bg-success p-3 px-4 fs-5 fw-bold text-white border border-1 rounded-3 ms-5'>Xut Excel</button>
                        </div>
                    </div>

                    <table className='table  table-hover table-bordered fs-5  mt-2 '>
                        <thead>
                            <tr className="table-secondary">
                                <th scope="col" className='p-3'>M HD</th>
                                <th scope="col" className='p-3'>Thi gian</th>
                                <th scope="col" className='p-3'>M KH</th>
                                <th scope="col" className='p-3'>Tn KH</th>
                                <th scope="col" className='p-3'>M NV</th>
                                <th scope="col" className='p-3'>Tn NV</th>
                                <th scope="col" className='p-3'>Hnh thc</th>
                                <th scope="col" className='p-3'>Tng tin</th>
                            </tr>
                        </thead>
                        <tbody>
                            {currentItems.map(item => (
                                <tr key={item.id} onClick={() => this.handleClickIdbillId(item.id)}>
                                    <td className='p-3'>{item.id}</td>
                                    <td className='p-3'>{item.date}</td>
                                    <td className='p-3'>{item.idKH}</td>
                                    <td className='p-3'>{item.nameKH}</td>
                                    <td className='p-3'>{item.idNV}</td>
                                    <td className='p-3'>{item.nameNV}</td>
                                    <td className='p-3'>{item.type}</td>
                                    <td className='p-3'>{item.total}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                    <div className='d-flex justify-content-center pt-3'>
                        {renderPageButtons()}
                    </div>
                </div>
                <div className="fixed-action-btn">
                    {/* <button className="btn btn-primary rounded-circle" onClick={this.openModalAdd}>
                        <i class="fas fa-plus fa-2x p-3 py-4" aria-hidden="true"></i>
                    </button> */}
                    {showModalRemove && (
                        <div className="modal modalRemove border border-2 rounded-3">

                            <div className="w-100 mt-2 text-center" >
                                <img style={{ height: "100px" }}
                                    src='../delete.gif'
                                    alt="Payment Image"
                                />
                                <h4 className="m-2">Xa ton b mc  chn?</h4>
                            </div>
                            <form method="POST" autoComplete="off" encType="multipart/form-data" className="ajax-form m-3 mt-0 bg-content-2 p-1 rounded-2    text-center">
                                <small className="text-center m-1 text-danger fs-5">( Bn c tht s mun xa, s khng th khi phc li d liu trong tng lai. )</small>
                            </form>
                            <div className=' row d-flex justify-content-bettwen mt-5'>
                                <div className='col-6 text-center'>
                                    <button className='w-75 bg-light-secondary p-3 border border-1 rounded-3 fs-5 fw-bold' onClick={this.closeModalRemove}>HY</button>
                                </div>
                                <div className='col-6 text-center'>
                                    <button className='w-75 bg-danger p-3 border border-1 rounded-3 fs-5 fw-bold'>XA</button>
                                </div>
                            </div>

                        </div>
                    )}
                    <style jsx>{`
                            .modalRemove {
                                display: block;
                                position: fixed;
                                top: 40%;
                                left: 50%;
                                transform: translate(-50%, -50%);
                                z-index: 1000;
                                background-color: white;
                                padding: 20px;
                                width: 400px; /* Set a specific width for the modal */
                                height: 300px; /* Set a specific height for the modal */
                            }
                            `}
                    </style>

                    {showModalAdd && (
                        <div className="modal modalAdd border border-2 rounded-3">
                            <div className='modal-header d-flex justify-content-bettwen px-3 fw-bold'>
                                <label className='fs-3'>THM NHN VIN</label>
                                <span className='fs-4' slot='end' onClick={this.closeModalAdd}>X</span>
                            </div>
                            <div className='modal-content border border-0 p-4'>
                                <div className='row'>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Tn nhn vin :<span className='text-danger'>*</span></label>
                                        <input type="text" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            Tn nhn vin
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">S in thoi :<span className='text-danger'>*</span></label>
                                        <input type="number" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            S in thoi
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Mt khu :<span className='text-danger'>*</span></label>
                                        <input type="password" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            Mt khu
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Ngy sinh :<span className='text-danger'>*</span></label>
                                        <input type="date" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            Ngy sinh
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">CMND/CCCD :<span className='text-danger'>*</span></label>
                                        <input type="text" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            CMND/CCCD
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Email :<span className='text-danger'>*</span></label>
                                        <input type="email" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            Email
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">a ch :<span className='text-danger'>*</span></label>
                                        <input type="text" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            a ch
                                        </div>
                                    </div>

                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Tnh:<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option disabled selected className='fs-5'>Chn Tnh/Thnh ph</option>
                                            <option value="1" className='fs-5'>H Ch MiNH</option>
                                            <option value="2" className='fs-5'>Bnh nh</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Qun/Huyn/Thnh ph :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option disabled selected className='fs-5'>Chn Qun/Huyn/Thnh ph</option>
                                            <option value="1" className='fs-5'>Tn Bnh</option>
                                            <option value="2" className='fs-5'>Bnh Tn</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">X/ Phng/ Th Trn :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option disabled selected className='fs-5'>Chn X/ Phng/ Th Trn</option>
                                            <option value="1" className='fs-5'>Phng 1</option>
                                            <option value="2" className='fs-5'>Phng 2</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Chc v :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option value="1" className='fs-5'>Nhn vin</option>
                                            <option value="2" className='fs-5'>Qun l</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Trng thi :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option value="1" className='fs-5'>Hot ng</option>
                                            <option value="2" className='fs-5'>Khng hot ng</option>
                                        </select>
                                    </div>
                                </div>
                                <div className=' row d-flex justify-content-end mt-5'>
                                    <button className='w-25 bg-light-secondary p-3 border border-1 rounded-3 fs-5 fw-bold' onClick={this.closeModalAdd}>HY</button>
                                    <button className='w-25 ms-5 bg-primary p-3 border border-1 rounded-3 fs-5 fw-bold'>THM</button>
                                </div>
                            </div>
                        </div>
                    )}
                    <style jsx>{`
                            .modalAdd {
                                display: block;
                                position: fixed;
                                top: 40%;
                                left: 55%;
                                transform: translate(-50%, -50%);
                                z-index: 1000;
                                background-color: white;
                                padding: 20px;
                                width: 50%; /* Set a specific width for the modal */
                                height: auto; /* Set a specific height for the modal */
                            }
                            `}
                    </style>
                    {showModalUpdate && (
                        <div className="modal modalAdd border border-2 rounded-3">
                            <div className='modal-header d-flex justify-content-bettwen px-3 fw-bold'>
                                <label className='fs-3'>SA THNG TIN NHN VIN</label>
                                <span className='fs-4' slot='end' onClick={this.closeModalUpdate}>X</span>
                            </div>
                            <div className='modal-content border border-0 p-4'>
                                <div className='row'>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Tn nhn vin :<span className='text-danger'>*</span></label>
                                        <input type="text" className="form-control p-3 rounded-3 fs-5" value={selectedbill?.name || ''}
                                            onChange={(e) => this.handleNameChange(e.target.value)}
                                        />
                                        <div className="invalid-feedback">
                                            Tn nhn vin
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">S in thoi :<span className='text-danger'>*</span></label>
                                        <input type="number" className="form-control p-3 rounded-3 fs-5" value={selectedbill?.phone || ''} readOnly />
                                        <div className="invalid-feedback">
                                            S in thoi
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Mt khu :<span className='text-danger'>*</span></label>
                                        <input type="password" className="form-control p-3 rounded-3 fs-5" />
                                        <div className="invalid-feedback">
                                            Mt khu
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Ngy sinh :<span className='text-danger'>*</span></label>
                                        <input type="date" className="form-control p-3 rounded-3 fs-5" value={selectedbill?.birthday || ''} />
                                        <div className="invalid-feedback">
                                            Ngy sinh
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">CMND/CCCD :<span className='text-danger'>*</span></label>
                                        <input type="text" className="form-control p-3 rounded-3 fs-5" value={selectedbill?.cccd || ''} />
                                        <div className="invalid-feedback">
                                            CMND/CCCD
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Email :<span className='text-danger'>*</span></label>
                                        <input type="email" className="form-control p-3 rounded-3 fs-5" value={selectedbill?.email || ''} readOnly />
                                        <div className="invalid-feedback">
                                            Email
                                        </div>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">a ch :<span className='text-danger'>*</span></label>
                                        <input type="text" className="form-control p-3 rounded-3 fs-5" value={selectedbill?.address || ''} />
                                        <div className="invalid-feedback">
                                            a ch
                                        </div>
                                    </div>

                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Tnh:<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option disabled selected className='fs-5'>Chn Tnh/Thnh ph</option>
                                            <option value="1" className='fs-5'>H Ch MiNH</option>
                                            <option value="2" className='fs-5'>Bnh nh</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Qun/Huyn/Thnh ph :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option disabled selected className='fs-5'>Chn Qun/Huyn/Thnh ph</option>
                                            <option value="1" className='fs-5'>Tn Bnh</option>
                                            <option value="2" className='fs-5'>Bnh Tn</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">X/ Phng/ Th Trn :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required
                                        >
                                            <option disabled selected className='fs-5'>Chn X/ Phng/ Th Trn</option>
                                            <option value="1" className='fs-5'>Phng 1</option>
                                            <option value="2" className='fs-5'>Phng 2</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Chc v :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required value={selectedbill?.chucvu || ''}
                                        >
                                            <option value="1" className='fs-5'>Nhn vin</option>
                                            <option value="2" className='fs-5'>Qun l</option>
                                        </select>
                                    </div>
                                    <div className='col-6 px-4 pt-3'>
                                        <label className="form-label fs-5">Trng thi :<span className='text-danger'>*</span></label>
                                        <select className="form-control p-3 fs-5  select2-hidden-accessible" required value={selectedbill?.status || ''}
                                        >
                                            <option value="1" className='fs-5'>Hot ng</option>
                                            <option value="2" className='fs-5'>Khng hot ng</option>
                                        </select>
                                    </div>
                                </div>
                                <div className=' row d-flex justify-content-end mt-5'>
                                    <button className='w-25 bg-light-secondary p-3 border border-1 rounded-3 fs-5 fw-bold' onClick={this.closeModalUpdate}>HY</button>
                                    <button className='w-25 ms-5 bg-primary p-3 border border-1 rounded-3 fs-5 fw-bold'>CP NHT</button>
                                </div>
                            </div>
                        </div>
                    )}
                </div>

            </div>
        );
    }
}

export default Detail;
